import React from "react";
  
const About = () => {
  return (
    <div>
        <section className="title">
          <h1>Tiago Almeida</h1>
          <h2>Copywriter</h2>
        </section>

        <section className="articles">
          <div className="article"><h3>Teste</h3></div>
        </section>
    </div>
  );
};
  
export default About;
